import React from 'react';
import { Radar, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis, ResponsiveContainer } from 'recharts';

interface Site {
  position: { x: number; y: number };
  scores: {
    safety: number;
    buildability: number;
    resources: number;
    expandability: number;
  };
  total_score: number;
}

interface SiteComparisonProps {
  sites: Site[];
}

const SiteComparison: React.FC<SiteComparisonProps> = ({ sites }) => {
  // Prepare data for radar chart (top 3 sites)
  const topSites = sites.slice(0, 3);

  // Format data for radar chart
  const radarData = [
    { subject: 'Safety', ...topSites.reduce((acc, site, idx) => ({...acc, [`site${idx+1}`]: site.scores.safety}), {}) },
    { subject: 'Buildability', ...topSites.reduce((acc, site, idx) => ({...acc, [`site${idx+1}`]: site.scores.buildability}), {}) },
    { subject: 'Resources', ...topSites.reduce((acc, site, idx) => ({...acc, [`site${idx+1}`]: site.scores.resources}), {}) },
    { subject: 'Expandability', ...topSites.reduce((acc, site, idx) => ({...acc, [`site${idx+1}`]: site.scores.expandability}), {}) },
    { subject: 'Total', ...topSites.reduce((acc, site, idx) => ({...acc, [`site${idx+1}`]: site.total_score}), {}) },
  ];

  return (
    <div>
      {sites.length > 0 ? (
        <div>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-6">
            {topSites.map((site, index) => (
              <div key={index} className="bg-gray-700 p-4 rounded-lg">
                <h4 className="font-bold text-lg mb-2">Site {index + 1}</h4>
                <div className="space-y-2">
                  <div className="flex justify-between">
                    <span>Position:</span>
                    <span>({site.position.x.toFixed(2)}, {site.position.y.toFixed(2)})</span>
                  </div>
                  <div className="flex justify-between">
                    <span>Safety:</span>
                    <span>{site.scores.safety.toFixed(1)}</span>
                  </div>
                  <div className="flex justify-between">
                    <span>Buildability:</span>
                    <span>{site.scores.buildability.toFixed(1)}</span>
                  </div>
                  <div className="flex justify-between">
                    <span>Resources:</span>
                    <span>{site.scores.resources.toFixed(1)}</span>
                  </div>
                  <div className="flex justify-between">
                    <span>Expandability:</span>
                    <span>{site.scores.expandability.toFixed(1)}</span>
                  </div>
                  <div className="flex justify-between font-bold border-t border-gray-600 pt-2">
                    <span>Total Score:</span>
                    <span>{site.total_score.toFixed(1)}</span>
                  </div>
                </div>
              </div>
            ))}
          </div>

          <div className="h-64">
            <ResponsiveContainer width="100%" height="100%">
              <RadarChart cx="50%" cy="50%" outerRadius="80%" data={radarData}>
                <PolarGrid stroke="#444" />
                <PolarAngleAxis dataKey="subject" tick={{ fill: '#aaa' }} />
                <PolarRadiusAxis angle={90} domain={[0, 100]} tick={{ fill: '#aaa' }} />
                {topSites.map((_, index) => (
                  <Radar
                    key={index}
                    name={`Site ${index + 1}`}
                    dataKey={`site${index + 1}`}
                    stroke={index === 0 ? '#8b5cf6' : index === 1 ? '#3b82f6' : '#ef4444'}
                    fill={index === 0 ? '#8b5cf6' : index === 1 ? '#3b82f6' : '#ef4444'}
                    fillOpacity={0.2}
                  />
                ))}
              </RadarChart>
            </ResponsiveContainer>
          </div>
        </div>
      ) : (
        <div className="text-center py-8 text-gray-500">
          <p>No sites to compare. The system is waiting for habitat analysis data.</p>
        </div>
      )}
    </div>
  );
};

export default SiteComparison;
